import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="App">
        <div><Header/></div>
        <ul>
            <li>CSS</li>
            <li>HTML</li>
            <li>JS</li>
        </ul>
    </div>
  );
}

const Header = () => {
    return (
        <div>
            <a href='#s'>Home</a>
            <a href='#s'>News feed</a>
        </div>
    )
}

export default App;
